    //写个函数,参数为一个回调函数 fn(key,val,obj)，深度遍历一个json对象，每一个属性都会触发回调函数
    function deepTraverseJson(obj, fn) {
        if (typeof obj !== 'object' || obj === null) {
            return;
        }
        for (const key in obj) {
            if (Object.prototype.hasOwnProperty.call(obj, key)) {
                const val = obj[key];
                // 触发回调函数
                fn(key, val, obj);
                // 递归遍历子对象
                if (typeof obj[key] === 'object' && obj[key] !== null) {
                    deepTraverseJson(obj[key], fn);
                }
            }
        }
    }

