        "Perplexity": "Perplexity",
        "Interact with the Perplexity API to generate AI responses with citations": "与Perplexity API交互，生成带引用的AI响应",
        "The model which will generate the completion": "将生成补全的模型",
        "Any optional system messages must be sent first, followed by alternating user and assistant messages": "任何可选系统消息必须首先发送，然后是交替的用户和助手消息",
        "Tell the model to adopt a specific tone or personality. Must alternate with user messages.": "告诉模型采用特定的语气或个性。必须与用户消息交替。",
        "Set the models behavior or context. Must come before user and assistant messages.": "设置模型行为或上下文。必须在用户和助手消息之前。",
