        "Role in shaping the model's response, it tells the model how it should behave and interact with the user": "在塑造模型响应中的作用，它告诉模型应该如何行为以及与用户交互",
        "Whether to return only essential fields (ID, citations, message)": "是否只返回基本字段（ID，引用，消息）",
        "Values greater than 1.0 penalize new tokens based on their existing frequency in the text so far, decreasing the model's likelihood to repeat the same line verbatim": "大于1.0的值根据新令牌在文本中出现的现有频率对其进行惩罚，从而降低模型逐字重复相同行的可能性",
        "The maximum number of tokens to generate in the completion. The number of tokens requested plus the number of prompt tokens sent in messages must not exceed the context window token limit of model requested.": "补全中要生成的最大令牌数。请求的令牌数加上消息中发送的提示令牌数不得超过模型请求的上下文窗口令牌限制。",
        "Output Randomness (Temperature)": "输出随机性（温度）",
        "The amount of randomness in the response, valued between 0 inclusive and 2 exclusive. Higher values are more random, and lower values are more deterministic.": "响应中的随机性量，值在0（包含）到2（不包含）之间。值越高越随机，值越低越确定。",
        "Top K": "Top K",
        "The number of tokens to keep for highest Top K filtering, specified as an integer between 0 and 2048 inclusive. If set to 0, Top K filtering is disabled. We recommend either altering Top K or Top P, but not both.": "用于最高Top K筛选的令牌数，指定为0到2048（包含）之间的整数。如果设置为0，则禁用Top K筛选。我们建议更改Top K或Top P，但不要同时更改。",
        "The nucleus sampling threshold, valued between 0 and 1 inclusive. For each subsequent token, the model considers the results of the tokens with Top P probability mass. We recommend either altering Top K or Top P, but not both.": "核采样阈值，值在0到1（包含）之间。对于每个后续令牌，模型会考虑具有Top P概率质量的令牌结果。我们建议更改Top K或Top P，但不要同时更改。",
        "A value between -2.0 and 2.0. Positive values penalize new tokens based on whether they appear in the text so far, increasing the model's likelihood to talk about new topics.": "介于-2.0和2.0之间的值。正值根据新令牌是否出现在文本中对其进行惩罚，从而增加模型谈论新主题的可能性。",
        "Return Images": "返回图片",
        "Whether or not a request to an online model should return images. Requires Perplexity API usage Tier-2.": "请求在线模型是否应返回图片。需要Perplexity API使用Tier-2。",
        "Return Related Questions": "返回相关问题",
        "Whether or not a request to an online model should return related questions. Requires Perplexity API usage Tier-2.": "请求在线模型是否应返回相关问题。需要Perplexity API使用Tier-2。",
