        "By default the launch just include the container ID. If this option gets activated, it will resolve the data automatically.": "默认情况下，启动只包含容器ID。如果激活此选项，它将自动解析数据。",
        "Arguments (JSON)": "参数（JSON）",
        "Agent argument. Can either be a JSON string or a plain object. The argument can be retrieved with buster.argument in the agent’s script.": "代理参数。可以是JSON字符串或普通对象。参数可以在代理脚本中使用buster.argument检索。",
