        "Whether to open the provided link within the iOS app or in Safari. Android PWA opens all links in the default web browser.": "是在iOS应用程序中还是在Safari中打开提供的链接。Android PWA在默认Web浏览器中打开所有链接。",
        "Push To Emails": "推送到电子邮件",
        "<p>Emails (strings) to whom to send the notification. If all three attributes 'pushToFollowers', 'pushToPhoneNumbers' and 'pushToEmails' are not supplied, then everyone who follows the channel will receive the push notification.</p><p>If 'pushToFollowers' is supplied, only those listed in the array will receive the push notification.</p><p>If one of the userIds supplied does not follow the specified channel, then that userId value will be ignored.</p><p>See the \"Followers\" section to learn how to list the userIds of those who follow one of your channels.</p>.": "<p>要发送通知的电子邮件（字符串）。如果未提供“pushToFollowers”、“pushToPhoneNumbers”和“pushToEmails”这三个属性，则所有关注该频道的人都将收到推送通知。</p><p>如果提供了“pushToFollowers”，则只有数组中列出的人才会收到推送通知。</p><p>如果提供的userIds中有一个不关注指定的频道，则该userId值将被忽略。</p><p>请参阅“关注者”部分，了解如何列出关注您频道的用户ID。</p>。",
        "Push To Followers": "推送到关注者",
        "<p>User IDs (strings) to whom to send the notification. If all three attributes 'pushToFollowers', 'pushToPhoneNumbers' and 'pushToEmails' are not supplied, then everyone who follows the channel will receive the push notification.</p><p>If 'pushToFollowers' is supplied, only those listed in the array will receive the push notification.</p><p>If one of the userIds supplied does not follow the specified channel, then that userId value will be ignored.</p><p>See the \"Followers\" section to learn how to list the userIds of those who follow one of your channels.</p>.": "<p>要发送通知的用户ID（字符串）。如果未提供“pushToFollowers”、“pushToPhoneNumbers”和“pushToEmails”这三个属性，则所有关注该频道的人都将收到推送通知。</p><p>如果提供了“pushToFollowers”，则只有数组中列出的人才会收到推送通知。</p><p>如果提供的userIds中有一个不关注指定的频道，则该userId值将被忽略。</p><p>请参阅“关注者”部分，了解如何列出关注您频道的用户ID。</p>。",
        "Push To Phone Numbers": "推送到电话号码",
        "<p>Phone numbers (strings) to whom to send the notification. If all three attributes 'pushToFollowers', 'pushToPhoneNumbers' and 'pushToEmails' are not supplied, then everyone who follows the channel will receive the push notification.</p><p>If 'pushToFollowers' is supplied, only those listed in the array will receive the push notification.</p><p>If one of the userIds supplied does not follow the specified channel, then that userId value will be ignored.</p><p>See the \"Followers\" section to learn how to list the userIds of those who follow one of your channels.</p>.": "<p>要发送通知的电话号码（字符串）。如果未提供“pushToFollowers”、“pushToPhoneNumbers”和“pushToEmails”这三个属性，则所有关注该频道的人都将收到推送通知。</p><p>如果提供了“pushToFollowers”，则只有数组中列出的人才会收到推送通知。</p><p>如果提供的userIds中有一个不关注指定的频道，则该userId值将被忽略。</p><p>请参阅“关注者”部分，了解如何列出关注您频道的用户ID。</p>。",
