        "Check if a LinkedIn profile (url format accepted: https://linkedin.com/in/USERNAME) is a first degree contact <a href=\"https://app.uproc.io/#/tools/processor/check/linkedin/profile-is-contact\" target='_blank'>Info</a>": "检查LinkedIn个人资料（接受URL格式：https://linkedin.com/in/USERNAME）是否为一级联系人<a href=\"https://app.uproc.io/#/tools/processor/check/linkedin/profile-is-contact\" target='_blank'>信息</a>",
        "Discover if mobile phone number exists in network operator, with worldwide coverage.<br>Get advanced mobile KPIs with <a href='/app/catalog/processor/get/mobile/lookup'>'Mobile lookup'</a> tool. <a href=\"https://app.uproc.io/#/tools/processor/check/mobile/exist\" target='_blank'>Info</a>": "发现手机号码是否存在于网络运营商，全球覆盖。<br>使用<a href='/app/catalog/processor/get/mobile/lookup'>“手机查找”</a>工具获取高级手机KPI。<a href=\"https://app.uproc.io/#/tools/processor/check/mobile/exist\" target='_blank'>信息</a>",
