        "Discover an email by company's name and prospect's firstname and lastname.<br><br>If the 'verify' method is selected, the tool checks multiple email variants in real-time, and returns a result depending on the email server response <a href=\"https://app.uproc.io/#/tools/processor/get/email/recipient-by-company-firstname-and-lastname\" target='_blank'>Info</a>": "通过公司名称和潜在客户的名字和姓氏发现电子邮件。<br><br>如果选择“验证”方法，该工具将实时检查多个电子邮件变体，并根据电子邮件服务器响应返回结果<a href=\"https://app.uproc.io/#/tools/processor/get/email/recipient-by-company-firstname-and-lastname\" target='_blank'>信息</a>",
