        "Discover an email by contact's LinkedIn profile URI <a href=\"https://app.uproc.io/#/tools/processor/get/email/recipient-by-profile\" target='_blank'>Info</a>": "通过联系人的LinkedIn个人资料URI发现电子邮件<a href=\"https://app.uproc.io/#/tools/processor/get/email/recipient-by-profile\" target='_blank'>信息</a>",
