        "This tools parses a social uri address and extracts any available indicators <a href=\"https://app.uproc.io/#/tools/processor/get/social/uri-parsed\" target='_blank'>Info</a>": "此工具解析社交URI地址并提取任何可用的指标<a href=\"https://app.uproc.io/#/tools/processor/get/social/uri-parsed\" target='_blank'>信息</a>",
