        "Get QR Code decoded content by an image URL <a href=\"https://app.uproc.io/#/tools/processor/get/qr/decoded\" target='_blank'>Info</a>": "按图片 URL 获取二维码解码内容 <a href=\"https://app.uproc.io/#/tools/processor/get/qr/decoded\" target='_blank'>信息</a>",
        "It allows to discover all geograhical and technical EXIF metadata present in a photographic JPEG image. <a href=\"https://app.uproc.io/#/tools/processor/get/image/exif\" target='_blank'>Info</a>": "它允许发现摄影 JPEG 图像中存在的所有地理和技术 EXIF 元数据。 <a href=\"https://app.uproc.io/#/tools/processor/get/image/exif\" target='_blank'>信息</a>",
