        "Check if domain has a valid SSL certificate <a href=\"https://app.uproc.io/#/tools/processor/check/domain/certificate\" target='_blank'>Info</a>": "检查域是否具有有效的 SSL 证书 <a href=\"https://app.uproc.io/#/tools/processor/check/domain/certificate\" target='_blank'>信息</a>",
