        "Check that an URL has a valid format <a href=\"https://app.uproc.io/#/tools/processor/check/url/valid\" target='_blank'>Info</a>": "检查 URL 格式是否有效 <a href=\"https://app.uproc.io/#/tools/processor/check/url/valid\" target='_blank'>信息</a>",
        "Get full SSL certificate data by domain (or website) and monitor your certificate status.<br><br>If domain has port 443 opened, a response will be returned. <a href=\"https://app.uproc.io/#/tools/processor/get/domain/certificate\" target='_blank'>Info</a>": "按域（或网站）获取完整的 SSL 证书数据并监控您的证书状态。<br><br>如果域打开了 443 端口，将返回响应。 <a href=\"https://app.uproc.io/#/tools/processor/get/domain/certificate\" target='_blank'>信息</a>",
        "Get text data from web, pdf or image (png, jpg, gif), allowing to filter some elements by regular expressions or field names (email, phone, zipcode).<br><br>Learn about regular expressions on [Wikipedia](https://en.wikipedia.org/wiki/Regular_expression) <a href=\"https://app.uproc.io/#/tools/processor/get/url/contents\" target='_blank'>Info</a>": "从网页、PDF 或图像（png、jpg、gif）获取文本数据，允许通过正则表达式或字段名称（电子邮件、电话、邮政编码）过滤某些元素。<br><br>了解正则表达式请访问 [Wikipedia](https://en.wikipedia.org/wiki/Regular_expression) <a href=\"https://app.uproc.io/#/tools/processor/get/url/contents\" target='_blank'>信息</a>",
        "Decode URL to recover original <a href=\"https://app.uproc.io/#/tools/processor/get/url/decode\" target='_blank'>Info</a>": "解码 URL 以恢复原始 URL <a href=\"https://app.uproc.io/#/tools/processor/get/url/decode\" target='_blank'>信息</a>",
