        "Tip: Get a feel for agents with our quick <a href=\"https://docs.n8n.io/advanced-ai/intro-tutorial/\" target=\"_blank\">tutorial</a> or see an <a href=\"/templates/1954\" target=\"_blank\">example</a> of how this node works": "提示：通过我们的快速<a href=\"https://docs.n8n.io/advanced-ai/intro-tutorial/\" target=\"_blank\">教程</a>了解代理，或查看此节点工作方式的<a href=\"/templates/1954\" target=\"_blank\">示例</a>",
        "This node is using Agent that has been deprecated. Please switch to using 'Tools Agent' instead.": "此节点正在使用已弃用的代理。请改用“工具代理”。",
        "Agent": "代理",
        "Describes tools in the system prompt and parses JSON responses for tool calls. More flexible but potentially less reliable than the Tools Agent. Suitable for simpler interactions or with models not supporting structured schemas.": "在系统提示中描述工具并解析工具调用的JSON响应。比工具代理更灵活，但可能可靠性较低。适用于更简单的交互或不支持结构化模式的模型。",
        "Leverages OpenAI's function calling capabilities to precisely select and execute tools. Excellent for tasks requiring structured outputs when working with OpenAI models.": "利用OpenAI的函数调用功能精确选择和执行工具。非常适合在使用OpenAI模型时需要结构化输出的任务。",
        "Creates a high-level plan for complex tasks and then executes each step. Suitable for multi-stage problems or when a strategic approach is needed.": "为复杂任务创建高级计划，然后执行每个步骤。适用于多阶段问题或需要战略性方法的情况。",
        "Combines reasoning and action in an iterative process. Effective for tasks that require careful analysis and step-by-step problem-solving.": "在迭代过程中结合推理和行动。适用于需要仔细分析和逐步解决问题的任务。",
        "Specializes in interacting with SQL databases. Ideal for data analysis tasks, generating queries, or extracting insights from structured data.": "专门与SQL数据库交互。非常适合数据分析任务、生成查询或从结构化数据中提取见解。",
        "Utilizes structured tool schemas for precise and reliable tool selection and execution. Recommended for complex tasks requiring accurate and consistent tool usage, but only usable with models that support tool calling.": "利用结构化工具模式进行精确可靠的工具选择和执行。建议用于需要准确一致的工具使用的复杂任务，但仅适用于支持工具调用的模型。",
