        "Random Seed": "随机种子",
        "The seed to use for random sampling. If set, different calls will generate deterministic results.": "用于随机采样的种子。如果设置，不同的调用将生成确定性结果。",
        "Ollama Chat Model": "Ollama聊天模型",
        "Language Model Ollama": "语言模型Ollama",
        "Controls the randomness of the generated text. Lower values make the output more focused and deterministic, while higher values make it more diverse and random.": "控制生成文本的随机性。较低的值使输出更集中和确定，而较高的值使其更具多样性和随机性。",
        "Limits the number of highest probability vocabulary tokens to consider at each step. A higher value increases diversity but may reduce coherence. Set to -1 to disable.": "限制每一步考虑的最高概率词汇令牌数量。较高的值会增加多样性，但可能会降低连贯性。设置为-1以禁用。",
        "Chooses from the smallest possible set of tokens whose cumulative probability exceeds the probability top_p. Helps generate more human-like text by reducing repetitions.": "从累积概率超过top_p概率的最小可能令牌集中选择。通过减少重复有助于生成更像人类的文本。",
        "Adjusts the penalty for tokens that have already appeared in the generated text. Higher values discourage repetition.": "调整对已在生成文本中出现的令牌的惩罚。较高的值会阻止重复。",
        "Keep Alive": "保持活跃",
        "Specifies the duration to keep the loaded model in memory after use. Useful for frequently used models. Format: 1h30m (1 hour 30 minutes).": "指定使用后将加载模型保留在内存中的持续时间。对于常用模型很有用。格式：1h30m（1小时30分钟）。",
        "Low VRAM Mode": "低VRAM模式",
        "Whether to Activate low VRAM mode, which reduces memory usage at the cost of slower generation speed. Useful for GPUs with limited memory.": "是否激活低VRAM模式，该模式以牺牲生成速度为代价减少内存使用。适用于内存有限的GPU。",
        "Main GPU ID": "主GPU ID",
        "Specifies the ID of the GPU to use for the main computation. Only change this if you have multiple GPUs.": "指定用于主计算的GPU ID。仅当您有多个GPU时才更改此项。",
        "Context Batch Size": "上下文批处理大小",
        "Sets the batch size for prompt processing. Larger batch sizes may improve generation speed but increase memory usage.": "设置提示处理的批处理大小。较大的批处理大小可能会提高生成速度，但会增加内存使用。",
        "Context Length": "上下文长度",
        "The maximum number of tokens to use as context for generating the next token. Smaller values reduce memory usage, while larger values provide more context to the model.": "用作生成下一个令牌的上下文的最大令牌数。较小的值减少内存使用，而较大的值向模型提供更多上下文。",
        "Number of GPUs": "GPU数量",
        "Specifies the number of GPUs to use for parallel processing. Set to -1 for auto-detection.": "指定用于并行处理的GPU数量。设置为-1表示自动检测。",
        "Max Tokens to Generate": "最大生成令牌数",
        "The maximum number of tokens to generate. Set to -1 for no limit. Be cautious when setting this to a large value, as it can lead to very long outputs.": "要生成的最大令牌数。设置为-1表示无限制。设置此值较大时请谨慎，因为它可能导致非常长的输出。",
        "Number of CPU Threads": "CPU线程数",
        "Specifies the number of CPU threads to use for processing. Set to 0 for auto-detection.": "指定用于处理的CPU线程数。设置为0表示自动检测。",
        "Penalize Newlines": "惩罚换行符",
        "Whether the model will be less likely to generate newline characters, encouraging longer continuous sequences of text": "模型是否不太可能生成换行符，从而鼓励更长的连续文本序列",
        "Adjusts the penalty for tokens based on their presence in the generated text so far. Positive values penalize tokens that have already appeared, encouraging diversity.": "根据令牌在已生成文本中的存在情况调整惩罚。正值惩罚已出现的令牌，鼓励多样性。",
        "Repetition Penalty": "重复惩罚",
        "Adjusts the penalty factor for repeated tokens. Higher values more strongly discourage repetition. Set to 1.0 to disable repetition penalty.": "调整重复令牌的惩罚因子。值越高，越强烈地阻止重复。设置为1.0以禁用重复惩罚。",
        "Use Memory Locking": "使用内存锁定",
