        "When using non-OpenAI models via \"Base URL\" override, not all models might be chat-compatible or support other features, like tools calling or JSON response format": "通过“Base URL”覆盖使用非OpenAI模型时，并非所有模型都可能与聊天兼容或支持其他功能，例如工具调用或JSON响应格式",
